import Navbar from 'react-bootstrap/Navbar';
import {Offcanvas, Container} from 'react-bootstrap';

function NaviBar() {

    return (
        <Navbar bg="light" expand={false}>
        <Container fluid>
          <Navbar.Brand href="#">FX's Portfolio</Navbar.Brand>
          <Navbar.Toggle aria-controls="offcanvasNavbar" />
          <Navbar.Offcanvas
            id="offcanvasNavbar"
            aria-labelledby="offcanvasNavbarLabel"
            placement='top'

          >
            <Offcanvas.Header closeButton>
              <Offcanvas.Title id="offcanvasNavbarLabel">FX's Portfolio</Offcanvas.Title>
            </Offcanvas.Header>
            <Offcanvas.Body>
              <h3>About FX..</h3>
              <p>Currently working as a Data Analyst in Perth, Australia. Fairly new to the Data industry, always keen to explore more and create wonderful projects. <br/>I have previously completed a certificate for Data Analytics from Univeristy of Western Australia (UWA) in 2021. This page show case the projects and challenges that I have completed. There are more projects coming soon, so stay tuned..</p>
            </Offcanvas.Body>
          </Navbar.Offcanvas>
        </Container>
      </Navbar>
    );
  }

  export default NaviBar;
